import {getUserData} from "./getUserData";

/*查询用户绑定的survey*/
export async function getUserSurveys(){
	const clientDocumentId = localStorage.getItem('token');
	const url = `http://localhost:1337/api/clients/${clientDocumentId}`;
	// 获取用户数据
	const data = await getUserData();
	return data.data.surveys;
}
